import java.util.*;public class QueueDemo {    public static void main(String[] args) {        Queue<Character> q = new LinkedList<Character>();        q.add('a');        q.add('b');        q.add('c');        System.out.println(q.add('e'));        q.remove();        q.add('d');        System.out.println(q.peek());        q.remove();        q.remove();        System.out.println(q.isEmpty());    }}